  return (
    <>
        <Header />
        <div className='confirmedbooking'>
            <div className="container">
                <h1>Your have reserved table successfully!</h1>
                <img src={ApprovalAnimated} alt="Animated Approval" />
            </div>
        </div>
        <Footer />
    </>
  )
}

export default ConfirmedBooking
